import React from 'react';
import Introduction from './components/Introduction';

function App() {
  const name = "Hello, I'm Manh Sy.";
  const introduction = "I am a fourth year Computer Science student from CSU, Sacramento. \nMy technical skills are Java, Python, Javascript, ";
  return (
    <div style = {{marginTop: 35}}> 
      <Introduction name = {name} description = {introduction}/>
